        def find_empty_space(board):
            for i in range(9):
                for j in range(9):
                    if board[i][j] == '.':
                        return (i, j)
            return None

        def is_valid(board, num, pos):
            # check row
            for i in range(9):
                if board[pos[0]][i] == num and pos[1] != i:
                    return False

            # check column
            for i in range(9):
                if board[i][pos[1]] == num and pos[0] != i:
                    return False

            # check box
            box_x = pos[0] // 3
            box_y = pos[1] // 3

            for i in range(box_x * 3, box_x * 3 + 3):
                for j in range(box_y * 3, box_y * 3 + 3):
                    if board[i][j] == num and (i, j) != pos:
                        return False

            return True

        def solve(board):
            empty = find_empty_space(board)

            if empty is None:
                return True

            for i in range(1, 10):
                if is_valid(board, str(i), empty):
                    board[empty[0]][empty[1]] = str(i)

                    if solve(board):
                        return True

